(15, 1, '2021-01-18 13:55:47', '2021-01-18 13:55:47', '[vc_row overflow=\"default\" css=\".vc_custom_1610978228961{padding-top: 0px !important;padding-bottom: 0px !important;}\"][vc_column][rev_slider slidertitle=\"Slider 1\" alias=\"slider-1\"][/vc_column][/vc_row][vc_row overflow=\"default\" css=\".vc_custom_1610979182757{padding-top: 48px !important;padding-bottom: 48px !important;}\"][vc_column][vcj_heading_simple content2=\"6O años encendiendo la\r\nvida de las familias\r\nperuanas en una sola llama\" color_text=\"#0056a4\" italic=\"\" size=\"xxl\" animation_speed=\"2\" animation_delay=\"0\"][vcj_text_block paragraph_whitespace=\"1\" margin=\"36px 0px 15px 0px\"]\r\n<p style=\"text-align: center;\">Estamos felices de que nos acompañes en este espacio creado\r\npara darte las mejores promociones y más.</p>\r\n[/vcj_text_block][/vc_column][/vc_row][vc_row full_width=\"stretch_row\" overflow=\"default\" css=\".vc_custom_1610979308660{padding-top: 48px !important;padding-bottom: 48px !important;background-image: url(https://grupoblindado.com/encendiendola/wp-content/uploads/2021/01/Combined-Shape@2x.png?id=18) !important;background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}\"][vc_column][vcj_single_image image=\"19\" alignment=\"center\" radius=\"0\" lightbox=\"1\" overlay=\"disabled\" animation_speed=\"2\" animation_delay=\"0\"][vcj_heading_simple content2=\"Un nuevo año\" color_text=\"#0056a4\" italic=\"\" size=\"xl\" animation_speed=\"2\" animation_delay=\"0\" margin=\"24px 0px 24px 0px\"][vcj_text_block paragraph_whitespace=\"1\"]\r\n<p style=\"text-align: center;\">Empezamos recargados de energía para brindarte las mejores\r\npromociones, recetas y tips que disfrutarás con tu familia.</p>\r\n[/vcj_text_block][vcj_text_block paragraph_whitespace=\"1\" text_size=\"12\" margin=\"24px 0px 15px 0px\"]\r\n<p style=\"text-align: center;\">No te despegues de nosotros que siempre te sorprenderemos con algo nuevo.</p>\r\n[/vcj_text_block][/vc_column][/vc_row][vc_row full_width=\"stretch_row\" overflow=\"default\" css=\".vc_custom_1610984446214{padding-top: 56px !important;padding-bottom: 56px !important;background-image: url(https://grupoblindado.com/encendiendola/wp-content/uploads/2021/01/Group-12.jpg?id=20) !important;background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}\"][vc_column width=\"1/2\"][vc_single_image image=\"21\" img_size=\"110x145\" alignment=\"right\"][/vc_column][vc_column width=\"1/2\"][vcj_heading_simple content2=\"Recetas exclusivas para ti\" color_text=\"#ffffff\" italic=\"\" size=\"xl\" animation_speed=\"2\" animation_delay=\"0\"][vcj_text_block paragraph_whitespace=\"1\" text_color=\"#ffffff\"]\r\n<p style=\"text-align: center;\">Sabemos que te encanta probar cosas nuevas y sorprender a tu familia, por eso cada mes te compartiremos diferentes recetas preparadas por los mejores chefs. ¡Perfectas para disfrutar en familia!</p>\r\n[/vcj_text_block][/vc_column][/vc_row][vc_row full_width=\"stretch_row\" overflow=\"default\" css=\".vc_custom_1610979814454{padding-top: 48px !important;padding-bottom: 4px !important;background-color: #0056a4 !important;}\"][vc_column][vc_single_image image=\"23\" img_size=\"full\" alignment=\"center\"][vcj_text_block paragraph_whitespace=\"1\" text_color=\"#ffffff\"]\r\n<p style=\"text-align: center;\">Síguenos en nuestras redes:</p>\r\n[/vcj_text_block][vcj_button text=\"PROMOCIONES y MÁS\" target=\"_self\" alignment=\"center\" font_weight=\"300\" radius=\"4\" border_size=\"2\" full=\"\" leftright_padding=\"36\" background_color=\"#78b950\" animation_speed=\"2\" animation_delay=\"0\"][vcj_single_image image=\"24\" alignment=\"center\" radius=\"0\" lightbox=\"1\" overlay=\"disabled\" animation_speed=\"2\" animation_delay=\"0\" margin=\"36px 0px 15px 0px\"][vc_separator color=\"custom\" accent_color=\"rgba(255,255,255,0.28)\" css=\".vc_custom_1610979873300{margin-bottom: 12px !important;padding-top: 7% !important;}\"][vcj_text_block paragraph_whitespace=\"1\" text_color=\"#ffffff\"]\r\n<p style=\"text-align: center;\">Limagas Derechos Reservados 2020 - Powered by Whiz</p>\r\n[/vcj_text_block][/vc_column][/vc_row]', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2021-01-18 16:00:55', '2021-01-18 16:00:55', '', 0, 'https://grupoblindado.com/encendiendola/?page_id=15', 0, 'page', '', 0),
